import React, { Component } from 'react';
import './NavigationMenu.css';
import {  Link } from "react-router-dom";

interface MenuProps {
    logo : string;
};


interface MenuState {
    showForm : boolean;
};

class NavigationMenu extends Component<MenuProps, MenuState> {
    constructor(props : any) {
        super(props);

        this.state = {
            showForm: false
        };
    }

    showForm() {
        this.setState({
            showForm: !this.state.showForm
        });
    }

    render() {








        return (

            <nav className="menu">
                <h1 style={{
                backgroundImage: 'url(' + this.props.logo + ')'
                }} className="menu__logo"></h1>


                <div className="menu__right">
                <h1>Purrfect Match </h1>



                    <ul className="">

                    <div>    

                            <Link to="home"className="menu__link menu__list menu__link--active">Real Home page</Link>  
                            <Link to="contact"className="menu__link menu__list menu__link--active">Contact Page</Link> 
                            <Link to="success" className="menu__link menu__list menu__link--active">Success Stories</Link> 
                            <Link to="search" className="menu__link menu__list menu__link--active">Search</Link> 
                            <Link to="donate" className="menu__link menu__list menu__link--active">Donation page</Link> 
                    </div>

                    </ul>


                </div>
            </nav>
        );
    }
}

export default NavigationMenu;
